    [],nt"revision_timestamp": "2015-05-07T03:34:19.071652",nt"name": "manufacture-of-novel-cryogenic-thermal-protection-materials-project-02ba0",nt"isopen":
    true,nt"url": null,nt"notes": "Advanced Materials Technology, Inc (AMTI)
    responds to the NASA SBIR solicitation X8 "Space Cryogenic Systems" under subtopic
    X8.01, "Cryogenic Fluid Transfer and Handling".  The proposed Phase I SBIR program
    is aimed at developing new cryogenic insulations for passive thermal control, resulting
    in zero boil-off storage of cryogens.  The passive thermal control will serve to
    limit the heat leak into the cryogenic storage system.  The proposed technology
    is expected to increase reliability, increase cryogenic system performance, and
    is capable of being made flight qualified for the flight systems and to meet Exploration
    Systems mission requirements.   We propose to develop advanced closed cell organic/inorganic
    hybrid microfoams offering affordable cost, lightweight, high strength, low thermal
    conductivity, high thermal stability, and easy processability which will result
    in improved efficiency and reliability of the cryogenic systems.  The proposed approach
    will be environmentally friendly and will not emit any volatile organic compound
    (VOC).   The closed cell structure of these novel foams will prevent the occurrence
    of cryopumping.   Once the feasibility of fabrication of strong, lightweight cryogenic
    insulating materials by the proposed technology is demonstrated in Phase I, we shall
    scale-up this technology in a Phase II program to meet the NASA's requirements.",nt"license_title":
